en.EPAL_DESC_103:
Check the cabling on CN1:
- in single-phase, make sure that ground cable is connected to PE, the Neutral cable is connected to N and the phase cable to T;
- in three-phase, make sure that the ground cable is connected to PE, the Neutral cable is connected to N and the phase cables L1, L2 and L3 are connected to R, S, and T.
